pub enum Event {
    Init,
    Mouse {
        point: Point,
        left_button: bool,
        middle_button: bool,
        right_button: bool,
    },
    KeyPressed(KeyEvent),
    KeyReleased(KeyEvent),
    Scroll {
        x: i32,
        y: i32,
    },
    Resize {
        width: u32,
        height: u32,
    },
    Unknown,
}
